import React, { useState } from 'react';
import './footer.css'
import FooterTop from './footer-top/FooterTop';
import FooterMiddle from './footer-middle/footerMiddle';

function Footer() {
    return (
        <div id="footer-cont">
            <div id="footer-inner">
                <FooterTop/>
                <FooterMiddle/>
            </div>
        </div>
    )
}

export default Footer;
